import React from 'react';
import '../style.css';



export default function Projects() {
  return (
    <div className='projects'>
        <div style={{background:'pink'}}class="container">
            <p>Projects</p>
            <p>A Selection of Stuff I've Built</p>
            <div class="container text-center">
            <div class="row">
                <h4 class="col-sm-5 col-md-6">Git Food.Travel</h4>
                <div class="col-sm-5 offset-sm-2 col-md-6 offset-md-0">.col-sm-5 .offset-sm-2 .col-md-6 .offset-md-0</div>
            </div>
            <div class="row">
                <p class="col-sm-6 col-md-5 col-lg-6">For when your stuck trying to find a place to eat or stay at the most luxurious hotel in the city, now you can search the top resturarnts or hotel in your city</p>

            </div>
            </div>
        </div>
    </div>
  );
}
